[Form]
public class ProdJournalTransRelease_RU extends FormRun implements LedgerIJournalForm
{
    ProdJournalFormTransRelease_RU journalFormTrans;
}

public void init()
{
    journalFormTrans = new ProdJournalFormTransRelease_RU(element);

    super();

    journalFormTrans.parmCtrlCheckJournal(checkJournal);
    journalFormTrans.parmCtrlPostJournal(postJournal);
    journalFormTrans.parmCtrlInfolog(showInfolog);
    journalFormTrans.parmCtrlVoucherGrid(prodJournalRelease_Voucher);
    journalFormTrans.parmCtrlVoucherTab(voucher);
    journalFormTrans.parmCtrlLineLogImage(lineLogImage);
    journalFormTrans.parmCtrlProdIdGrid(ctrlGridProdId);
    journalFormTrans.parmCreateCancel(createCancel);
    journalFormTrans.parmCreateFromInventByProduct(createFromInventByProduct);

    journalFormTrans.formInitPost();
}

public void displayOption(Common _prodJournalRelease,
                          FormRowDisplayOption  _options)
{
    #define.Value180(180)

    ProdJournalRelease_RU tmpJournalRelease = _prodJournalRelease;
    if (tmpJournalRelease.OffsetTransRefRecId)
    {
         _options.backColor(WinAPI::rgb2int(#Value180, #Value180, #Value180));
    }

    super(_prodJournalRelease, _options);
}

public void write()
{
    ttsbegin;

    journalFormTrans.datasourceWritePre();

    super();

    journalFormTrans.datasourceWritePost();

    ttscommit;
}

public void delete()
{
    ttsbegin;

    journalFormTrans.datasourceDeletePre();

    super();

    journalFormTrans.datasourceDeletePost();

    ttscommit;
}

public void create(boolean append = false)
{
    journalFormTrans.datasourceCreatePre();

    super(append);

    journalFormTrans.datasourceCreatePost();
}

public int active()
{
    int ret = super();

    journalFormTrans.datasourceActivePost();

    return ret;
}

